const tasks = [
  {
    id: 1,
    text: "Study",
    day: "Saturday",
    reminder: true,
  },
  {
    id: 2,
    text: "gym",
    day: "Monday",
    reminder: true,
  },
  {
    id: 3,
    text: "Tennis",
    day: "Thursday",
    reminder: false,
  },
];

const Tasks = (props) => {
  return (
    <div>
      {tasks.map((task) => {
        <h3>{props.text}</h3>;
      })}
    </div>
  );
};

export default Tasks;
